ng\",\"copyright\":{\"license\":\"U\"},\"width\":1575,\"height\":632},\"decorative\":false,\"expandImage\":\"Expand Image\",\"minimizeImage\":\"Minimize Image\"},\"subContentId\":\"957fef50-6820-4065-8203-3605bbfd18c8\",\"metadata\":{\"contentType\":\"Image\",\"license\":\"U\",\"title\":\"Untitled Image\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":12.841091492776885,\"y\":88.77869057772732,\"width\":70.62600321027287,\"height\":9.507056320567168,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Note:</strong><br />\\n<span style=\\\"font-size:0.875em\\\"><em>The last energy level of an atom never holds more than \\\\(8e^-\\\\) even if it is shell M or N...</em></span></p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"6477a52d-2e4e-4487-9bfd-9b70b4e9e295\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"slideBackgroundSelector\":{},\"elements\":[{\"x\":1.331203407880724,\"y\":0,\"width\":98.66879659211928,\"height\":100,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<h3 style=\\\"text-align:center\\\"><span style=\\\"color:#009e8c\\\"><strong>Electronic Configuration</strong></span></h3>\\n\\n<p><span><span><span><strong><span><span><span>Electronic Configuration</span></span></span></strong><span><span><span>:</span></span></span><span><span><span> It is the distribution of electrons on energy levels. </span></span></span></span></span></span></p>\\n\\n<p>To write the electronic configuration of an atom, abide by these rules:</p>\\n\\n<ol>\\n\\t<li>Place the electrons with lower energy level first (start with K, next L, then M, last N). </li>\\n\\t<li>Do not exceed the maximum number of electrons in each energy level.</li>\\n\\t<li>The last energy level of an atom never holds more than \\\\(8e^-\\\\).</li>\\n</ol>\\n\\n<p><strong>For example: Write the electronic configuration of \\\\(_{20}Ca \\\\).</strong></p>\\n\\n<p><span><span><span><span><span><span>In a neutral atom, Z = Atomic number = number of protons = number of electrons</span></span></span></span></span></span></p>\\n\\n<p><span><span><span><span><span><span>\\\\(_{20}Ca \\\\) : \\\\( K^2 \\\\), \\\\( L^8 \\\\), \\\\( M^{10} \\\\)</span></span></span></span></span></span> (This is wrong.)</p>\\n\\n<p>The energy level M can contain \\\\(18e^-\\\\), but since the last shell cannot contain more than \\\\(8e^-\\\\), the \\\\(2e^-\\\\) move to the next shell N.</p>\\n\\n<p>Then, the electronic configuration of calcium is <strong><span><span><span><span><span><span>\\\\(_{20}Ca \\\\) : \\\\( K^2 \\\\), \\\\( L^8 \\\\), \\\\( M^8 \\\\), \\\\( N^2 \\\\).</span></span></span></span></span></span></strong></p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"cb4e632b-e3cd-4cde-8057-a39dce4355a2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":64.85124359979989,\"y\":88.45454656369338,\"width\":5.153357750341241,\"height\":8.31167722020912,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAJ0AAACBCAYAAADaMrg2AAAACXBIWXMAABcRAAAXEQHKJvM/AAAEX0lEQVR4nO3d620TURCG4S+IAlICJdBCSqADSA0pIxIdBDqADmiBUlICSuyBGK/XezmXmTnv+8vW/llbj7Ta25kbET09fpT0Q9In3T/8rv1/gG70DuB+SbqV9CzprjY80I3cKTirOjzQjdo0OKsqPNCN2Dw4qxo80I3WMnBWFXigG6l14Kzi8EA3StvAWUXhgW6E9oGzisEDXfbKgLO rn periodic table, elements are arranged in <strong>increasing order of atomic number (Z).</strong></span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span>There are <strong>18 columns, 8 groups, &amp; 7 periods</strong> (rows) in the modern periodic table.</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span><strong>Period = Row</strong> = number of energy levels.</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span><strong>Valence electrons</strong> = number of electrons in the last shell (outermost shell)</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span><strong>Group</strong> = number of electrons in the last shell OR number of valence electrons (in Roman numbers)</span></span></span></span></span></span></li>\\n\\t<li><span><span><span><span><span><span><strong>Column</strong> = number of valence electrons + 10 (if valence electrons &gt; 2)</span></span></span></span></span></span></li>\\n\\t<li><span><span><span>Elements in the periodic table are classified as:</span></span></span></li>\\n</ul>\\n\\n<p>             - <span><span><span> metals (Groups I, II, &amp; III / Elements to the left of the stair-step line except hydrogen)</span></span></span></p>\\n\\n<p><span><span><span>             - non-metals (Groups IV, V, VI, VII, VIII / Elements to the right of the stair-step line); and</span></span></span></p>\\n\\n<p><span><span><span>             - metalloids / semimetals (elements next to the stair-step line, except aluminum and polonium).</span></span></span></p>\\n\"},\"subContentId\":\"e573ed5b-16d0-4c20-a8d8-d62398d9b7eb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solutio :{\"params\":{\"text\":\"<h3><strong>Exercise 2: Element X</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"449239d9-1a78-4695-90fe-262b0614e7b6\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Determine the atomic number of element X located in the second group and the third row in the periodic table.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"b53170cd-0dba-465a-b4ce-e9bc005e5ebc\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2. Identify element X.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"e448bfae-059e-497e-95de-51ab41900f8e\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"f7497717-e955-432a-822f-d8056082de3e\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Since element X belongs to the third row, it has 3 energy levels K, L, and M.</p>\\n\\n<p>Element X belongs to the second group, so it has 2 valence electrons.</p>\\n\\n<p>The electronic configuration of X is \\\\( k^{2},L^{8},M^{2} \\\\) (M cannot be filled unless K and L are completely filled).</p>\\n\\n<p>Total number of electrons = 2 + 8 + 2 = 12</p>\\n\\n<p>In a neutral atom, the number of protons = number of electrons = 12</p>\\n\\n<p>Atomic number (Z) = Number of protons = 12</p>\\n\\n<p>2. Atomic number (Z) determines the identity of an element.</p>\\n\\n<p>Z = 12 refers to magnesium (Mg).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a5fd287d-af16-40bd-85c5-d9b778f6bbdf\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"f4a6d278-0dec-41bd-8442-c9baf8c1da55\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Element X\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Element X\"},\"subContentId\":\"811eb039-7f8b-4c59-a643-d666967ec8c3\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Exercise 3: Unknown Elements</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"36cb60a2-8824-407e-97d8-78e1aa4ace21\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Glass etching lotion, available from art supply stores, consists of fluoride compounds, such as sodium fluoride \\\\(NaF\\\\) and hydrogen fluoride \\\\(HF\\\\). Glass is composed of about 75% silicon dioxide \\\\(SiO_2\\\\), the rest can be sodium oxide \\\\({Na}_2O\\\\), calcium oxide \\\\(CaO\\\\), and several minor additives. Air at high pressure mixed with the lotion permits the etching of the glass. <br />\\nThe table belo tomic numbers.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"f5a6e990-6ae3-4af6-b5ad-b83b98ec0f9c\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. Identify the elements.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"dc3edafe-f6fa-4905-83c4-2a3a9037a10d\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. Chlorine (Cl) and element X are in the same group (column); but chlorine is 1 row below element X.  Deduce its atomic number.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"686e47cd-e6e5-4cf7-8130-191f2e0d294f\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>5. Pick out from the text the names of the chemical compounds used for glass etching.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"65f4d5db-bfbd-448f-92a4-68c5964d770c\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"a7740803-adbb-4a38-8c3c-17d90aee4ca8\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Since element X is the first halogen, it belongs to row 2 (halogens start from row 2) and group VII, so it has 2 energy levels K and L and 7 valence electrons.</p>\\n\\n<p>Thus, the electronic configuration of X is \\\\( k^{2},L^{7}\\\\).</p>\\n\\n<p>Since element Y is the second noble gas, it belongs to row 2 (noble gases start from row 1) and group VIII, so it has 2 energy levels K and L and 8 valence electrons.</p>\\n\\n<p>Thus, the electronic configuration of Y is \\\\( k^{2}, L^{8}\\\\).</p>\\n\\n<p>Since element Z is the second alkali metal, it belongs to row 3 (alkali metals start from row 2) and group I, so it has 3 energy levels K, L and M and 1 valence electron.</p>\\n\\n<p>Thus, the electronic configuration of Z is \\\\( k^{2}, L^{8}, M^{1}\\\\).</p>\\n\\n<p>2. <strong>Element X</strong></p>\\n\\n<p>Total number of electrons = 2 + 7 = 9</p>\\n\\n<p>In a neutral atom, the number of protons = number of electrons = 9</p>\\n\\n<p>Atomic number (Z) = Number of protons = 9</p>\\n\\n<p><strong>Element Y</strong></p>\\n\\n<p>Total number of electrons = 2 + 8 = 10</p>\\n\\n<p>In a neutral atom, the number of protons = number of electrons = 10</p>\\n\\n<p>Atomic number (Z) = Number of protons = 10</p>\\n\\n<p><strong>Element Z</strong></p>\\n\\n<p>Total number of electrons = 2 + 8 + 1 = 11</p>\\n\\n<p>In a neutral atom, the number of protons = number of electrons = 11</p>\\n\\n<p>Atomic number (Z) = Number of protons = 11</p>\\n\\n<p>3. The atomic number (Z) determines the identity of an element.</p>\\n\\n<p>Z = 9 refers to fluorine (F)</p>\\n\\n<p>Z = 10 refers to neon (Ne)</p>\\n\\n<p>Z = 11 refers to sodium (Na)</p>\\n\\n<p>4. The electronic configuration of X is \\\\(k^{2}, L^{7}\\\\)</p>\\n\\n<p>Chlorine is just below X which means that it has 3 energy levels, and since it belongs to the same group, it has 7 valence electrons.</p>\\n\\n<p>Thus, the electronic configuration of chlorine is \\\\(k^{2}, L^{8}, M^{7}\\\\).</p>\\n\\n<p>Total number of electrons = 2 + 8 + 7 = 17</p>\\n\\n<p>In a neutral atom, the number of protons = number of electrons = 17</p>\\n\\n<p>Atomic number (Z) = Number of protons = 17</p>\\n\\n<p>5. (\\\\(NaF\\\\)) and (\\\\(H
